import React, { useState, useEffect } from 'react';

const VisionPage = () => {
  const [visionText, setVisionText] = useState('');
  const [weeklyGoals, setWeeklyGoals] = useState('');
  const [monthlyGoals, setMonthlyGoals] = useState('');
  const [yearlyGoals, setYearlyGoals] = useState('');
  const [activeTab, setActiveTab] = useState('weekly');
  const [isEditing, setIsEditing] = useState(true);

  useEffect(() => {
    const savedVision = localStorage.getItem('visionData');
    if (savedVision) {
      const data = JSON.parse(savedVision);
      setVisionText(data.visionText || '');
      setWeeklyGoals(data.weeklyGoals || '');
      setMonthlyGoals(data.monthlyGoals || '');
      setYearlyGoals(data.yearlyGoals || '');
      setIsEditing(false);
    }
  }, []);

  const saveVision = () => {
    const visionData = {
      visionText,
      weeklyGoals,
      monthlyGoals,
      yearlyGoals,
    };
    localStorage.setItem('visionData', JSON.stringify(visionData));
    setIsEditing(false);
    alert('💾 החזון והיעדים נשמרו בהצלחה!');
  };

  const resetVision = () => {
    setVisionText('');
    setWeeklyGoals('');
    setMonthlyGoals('');
    setYearlyGoals('');
    localStorage.removeItem('visionData');
    setIsEditing(true);
    alert('🗑️ החזון והיעדים נמחקו בהצלחה!');
  };

  return (
    <div className="container mx-auto p-8 bg-white rounded-md shadow-md max-w-5xl">
      {/* כותרת */}
      <h1 className="text-3xl font-bold mb-6 text-center">🌟 חזון אישי ויעדים 🌟</h1>

      {/* כפתורים */}
      <div className="flex gap-4 justify-center mb-6">
        <button
          onClick={saveVision}
          className="bg-green-500 text-white px-4 py-2 rounded-md"
          disabled={!isEditing}
        >
          💾 שמור הכל
        </button>
        <button
          onClick={resetVision}
          className="bg-red-500 text-white px-4 py-2 rounded-md"
        >
          🗑️ מחק הכל
        </button>
      </div>

      {/* חזון אישי */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">📜 כתיבת חזון אישי</h2>
        <textarea
          value={visionText}
          onChange={(e) => setVisionText(e.target.value)}
          placeholder="דוגמה: אני מנהל את הזמן שלי בצורה יעילה, משיג יציבות כלכלית ונהנה מהדרך."
          className="w-full h-32 p-2 border rounded-md"
          disabled={!isEditing}
        />
      </section>

      {/* כרטיסיות יעדים */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">🎯 יעדים</h2>
        <div className="flex gap-4 mb-4">
          <button
            onClick={() => setActiveTab('weekly')}
            className={`px-4 py-2 rounded-md ${
              activeTab === 'weekly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
            }`}
          >
            🗓️ שבועיים
          </button>
          <button
            onClick={() => setActiveTab('monthly')}
            className={`px-4 py-2 rounded-md ${
              activeTab === 'monthly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
            }`}
          >
            📅 חודשיים
          </button>
          <button
            onClick={() => setActiveTab('yearly')}
            className={`px-4 py-2 rounded-md ${
              activeTab === 'yearly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
            }`}
          >
            🏆 שנתיים
          </button>
        </div>

        {activeTab === 'weekly' && (
          <textarea
            value={weeklyGoals}
            onChange={(e) => setWeeklyGoals(e.target.value)}
            placeholder="דוגמה: לסיים קריאת פרק בספר עיוני ולהשקיע שעה ביום בפיתוח מיומנות חדשה."
            className="w-full h-32 p-2 border rounded-md"
            disabled={!isEditing}
          />
        )}

        {activeTab === 'monthly' && (
          <textarea
            value={monthlyGoals}
            onChange={(e) => setMonthlyGoals(e.target.value)}
            placeholder="דוגמה: לחסוך 500 ש״ח מההכנסות החודשיות ולהתחיל שגרת אימונים קבועה."
            className="w-full h-32 p-2 border rounded-md"
            disabled={!isEditing}
          />
        )}

        {activeTab === 'yearly' && (
          <textarea
            value={yearlyGoals}
            onChange={(e) => setYearlyGoals(e.target.value)}
            placeholder="דוגמה: להקים עסק קטן משלי, להשיג עצמאות כלכלית ולצאת לחופשה שתכננתי."
            className="w-full h-32 p-2 border rounded-md"
            disabled={!isEditing}
          />
        )}
      </section>
    </div>
  );
};

export default VisionPage;
